import React from 'react'

export default function MusicNote({black}){
	const fill = black ? 'black' : 'white'
	const stroke = black ? 'red' : 'black'

	return(
		<div style={{
        backgroundColor: fill,
        color: stroke,
        width: '100%',
        height: '100%'
      }}> 
			<img src = {process.env.PUBLIC_URL + 'music-note.png'}/>
		</div>)
}
